import { useEffect, useState } from "react";

export const useFetchMoviesId = (movie: any) => {
  const [movies, setMovies] = useState<IMovies[]>([]);

  useEffect(() => {
    fetch(`https://my-json-server.typicode.com/cristianmeelo/cinetag-api/movies?=${params.id}`)
      .then((response) => response.json())
      .then((data) => setMovies(data));
  }, []);

  return { movie };
};
